import React from "react";
import styled from "styled-components";

const NavLink = (props) => {
    const Link = styled.a`
    color: red;
    ${(props) =>
      props.primary &&
      css`
        color: green;
      `}
  `;
    return <Link>{props.children}</Link>;
};

export default NavLink;
